import React from 'react';
import './App.css';
import {BrowserRouter as Router, Link, Route, Switch} from 'react-router-dom';
import Home from './components/Home';
import CreateAPost from './components/CreateAPost';
import ShowCurrentPosts from './components/ShowCurrentPosts';


export default function App() {
  return (
    <Router>
    <section>
      <nav className="navigation">
        <li><Link to="/"></Link>Home</li>
        <li><Link to ="CreateAPost"></Link>Create A Post</li>
        <li><Link to="ShowCurrentPosts"></Link>Show Current Posts</li>
      </nav>


    </section>
    <Switch>
        <Route exact path="/" component={Home} />
        <Route path="./CreateAPost" component={CreateAPost} />
        <Route path="./ShowCurrentPosts" component= {ShowCurrentPosts} />
        </Switch>
    </Router>
  )
}
